import React, {useState, useEffect } from 'react'
import axios from 'axios';

const Code = () => {
    const [data,setData] = useState([])
    useEffect(()=>{
        try{
            axios.get("https://dummyjson.com/todos").then((Response)=>{
                console.log(Response.data.todos);
                setData(Response)
                
            })
        }catch(error){
            console.log(error);
            
        }

    },[])
  return (
    <>

    </>
  )
}

export default Code
